import React from "react";
import Nav from "../generalLayout/nav";
// import { Helmet } from "react-helmet";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
const namePage = "Dragster 800 RR SCS";
const listImgs = [
  {
    contentTitle: "EMOTIONS WITHOU COMPROMISE",
    img: "DRA-SCS-performance-min.png",
    content:
      "Super compact, aggressive, stunningly good looking. The design of the Dragster 800 RR takes no prisoners. Emotion in its purest form.",
  },
  {
    contentTitle: "EVOLUTION <br/> OF PERFECTION",
    img: "DRA-SCS-meccanica-min.png",
    content:
      "The three-cylinder engine was improved to comply with Euro 4 regulation and also to enhance performance and reliability. The engineâ€™s anchoring point to the frame has been revised, as well as the primary gears, valve guides and the cam phasing. The gearbox is also new, quicker and requires less force on the lever to engage gears.",
  },
  {
    img: "DRA-SCS-design-min.png",
    content:
      "The front fenderâ€™s side supports are made of aluminium, like the tank damper. The headlight has a new integrated light guide and the tail light is now a single unit.",
  },
  {
    img: "mv-3-years-warranty.jpg",
    content:
      "MV Agusta offers a NEW 3 YEARS WARRANTY on the whole range, with a great service support for all customers. Customize your experience riding a model, discovering special kits and the vast range of readily available spare parts.",
  },
];
export default function BodyDragster800RRSCS() {
  function scrollFunction() {
    if (document.documentElement.scrollTop > window.innerHeight / 3) {
      document
        .getElementsByClassName("mv-nav")[0]
        .classList.add("mv-nav-onScroll");
      for (
        var i = 0;
        i < document.getElementsByClassName("mv-container-div").length;
        i++
      ) {
        document
          .getElementsByClassName("mv-container-div")
          [i].classList.add("mv-container-div-onScroll");
      }
      document.getElementsByClassName("mv-nav-compact")[0].style.display =
        "flex";
      document
        .getElementsByClassName("mv-nav")[0]
        .classList.add("openMainMenu");
    } else {
      document
        .getElementsByClassName("mv-nav")[0]
        .classList.remove("mv-nav-onScroll");
      for (
        var key = 0;
        key < document.getElementsByClassName("mv-container-div").length;
        key++
      ) {
        document
          .getElementsByClassName("mv-container-div")
          [key].classList.remove("mv-container-div-onScroll");
      }
      document.getElementsByClassName("mv-nav-compact")[0].style.display =
        "none";
      document
        .getElementsByClassName("mv-nav")[0]
        .classList.remove("openMainMenu");
    }
  }

  window.onscroll = function () {
    scrollFunction();
  };

  return (
    <>
      <PageName namePage={namePage}></PageName>
      <Nav />
      <Motor3d
        imgLocate="dragster800/dragster800rr"
        nameModel="ð™ˆð™«-ð™–ð™œð™ªð™¨ð™©ð™– ð˜¿ð™§ð™–ð™œð™¨ð™©ð™šð™§ 800 ð™ð™"
        price="18Kâ‚¬"
        listImgs = {listImgs}
      />
    </>
  );
}

